import React, { Component } from 'react';
import ReactApexChart from 'react-apexcharts';

class ApexRevenue extends Component {
    constructor(props) {
        super(props);

        this.state = {
            options: {
                chart: {
                    height: 300,
                    type: "bar",
                    toolbar: {
                        show: !1
                    }
                },
                plotOptions: {
                    bar: {
                        horizontal: !1,
                        columnWidth: "14%",
                        endingShape: "rounded"
                    }
                },
                dataLabels: {
                    enabled: !1
                },
                stroke: {
                    show: !0,
                    width: 2,
                    colors: ["transparent"]
                },
                series: [{
                    name: "Revenue",
                    data: [42, 85, 101, 56, 37, 105, 38, 58, 92, 82, 72, 32]
                }],
                xaxis: {
                    categories: ["Jan", "Feb", "Mar", "Apr", "May", "Jun", "Jul", "Aug", "Sep", "Oct", "Nov", "Dec"]
                },
                yaxis: {
                    title: {
                        text: "$(thousands)"
                    }
                },
                fill: {
                    opacity: 1
                },
                colors: ["#556ee6"],
            },
            series: [{
                name: "Revenue",
                data: [42, 85, 101, 56, 37, 105, 38, 58, 92, 82, 72, 32]
            }],
        }
    }

    render() {
        return (
            <React.Fragment>
                <ReactApexChart options={this.state.options} series={this.state.series} type="bar" height="300" />
            </React.Fragment>
        );
    }
}

export default ApexRevenue;
